import React from 'react'
import './Profile.css'

const Profile = () => {
  return (
    <div className='container shadow mt-3'>
        <div className="row">
            <div className="col-md-6 d-flex flex-column">
            <img style={{borderRadius:'15px'}} src="https://images.unsplash.com/photo-1602127601986-47e4de8ffcdf?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHx0b3BpYy1mZWVkfDE4fEZ6bzN6dU9ITjZ3fHxlbnwwfHx8fHw%3D" alt="Post Pic" className="img-fluid p-2 profile-pic" />
            {/* <img className='profile-pic' alt='Profile' src='https://images.unsplash.com/photo-1511739001486-6bfe10ce785f?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHx0b3BpYy1mZWVkfDYzfEZ6bzN6dU9ITjZ3fHxlbnwwfHx8fHw%3D' /> */}
            </div>
            <div className="col-md-6">right</div>
        </div>
    </div>
  )
}

export default Profile
